import styled from 'styled-components'

const SwatchPickerStyle = styled.div`
	background-color: pink;
	width: 90%;

	.button-container {
		border: 1px solid black;
	}

	.swatch-div {
		border: 1px solid black;
		width: 6rem;
		height: 6rem;
	}
	.swatch-div-container {
		border: 1px solid black;
	}
`

export default SwatchPickerStyle
